from sympy import divisors
from fractions import Fraction
def aupto(limit):
  alst, prev_divavg = [], 1
  for n in range(2, limit+2):
    divs = divisors(n)
    divavg = Fraction(sum(divs), len(divs))
    if divavg == prev_divavg: alst.append(n-1)
    prev_divavg = divavg
  return alst
